import React from "react";
import { Container, Row, Col } from "react-bootstrap";
import myImg from "../../Assets/avatar.svg";
import Tilt from "react-parallax-tilt";
import {
  AiFillGithub,
  AiOutlineTwitter,
  AiFillInstagram,
} from "react-icons/ai";
import { FaLinkedinIn } from "react-icons/fa";
import cat1 from "../../Assets/cat1real.png";
import { useState } from "react";
import ReactDOM from "react-dom";
import CollapsiblePanel from "./CollapsiblePanel";

function App() {
    const text1 =
        "Shorten";
    const text2 = "Hello my name is Jun";
    const text3 = "I am making this website";
    const text4 = "Currently I am doing that";
    const [collapse, setCollapse] = useState(true);
    const [title, setTitle] = useState("Expand All");
    const [icon, setIcon] = useState("fa fa-chevron-right");
    const collapseAll = () => {
        setCollapse(!collapse);
        setIcon(state => {
            return state === "fa fa-chevron-right"
                ? "fa fa-chevron-down"
                : "fa fa-chevron-right";
        });
        setTitle(state => {
            return state === "Expand All" ? "Collapse All" : "Expand All";
        });
    };
    return (
        <div>
            {/* Expand/Collapse All */}
            {/* <button
                type="button"
                className="btn-warning mt-4 mb-3 float-left"
                onClick={collapseAll}
            >
                <i className={icon} /> {title}
            </button> */}
            <Row noGutters>
                {/* <center>
            <Col className="hate" md={1} style={{ paddingTop: 50, paddingRight: 0 }}>
            <img
              className="hate"
              src={cat1}
              alt="home pic"
            //   className="img-fluid"
              style={{ maxHeight: "85px" }}
            />
          </Col>
          </center> */}
          <center>
          <Col md={1} className="hate" style={{ paddingTop: 50, paddingLeft: 0 }}>
          <CollapsiblePanel className="hate" title="Create a Wallet" collapse={collapse}>
                <span>{text1}</span>
            </CollapsiblePanel>
          </Col>
          </center>
          </Row>

          <Row>
            {/* <Col md={4} style={{ paddingTop: 50 }}>
            <img
              src={cat1}
              alt="home pic"
            //   className="img-fluid"
              style={{ maxHeight: "85px" }}
            />
          </Col> */}

          <Col md={6} style={{ paddingTop: 50 }}>
          <CollapsiblePanel title="Get some Sol" collapse={collapse}>
                {text2}
            </CollapsiblePanel>
          </Col>
          </Row>

            <Row>
            <Col md={4} style={{ paddingTop: 50 }}>
            <img
              src={cat1}
              alt="home pic"
            //   className="img-fluid"
              style={{ maxHeight: "85px" }}
            />
          </Col>
          <Col md={8} style={{ paddingTop: 50 }}>
          <CollapsiblePanel title="Connect to Dexscreener/Jupiter" collapse={collapse}>
                <span>{text3}</span>
            </CollapsiblePanel>
          </Col>
          </Row>

          <Row>
            <Col md={4} style={{ paddingTop: 50 }}>
            <img
              src={cat1}
              alt="home pic"
            //   className="img-fluid"
              style={{ maxHeight: "85px" }}
            />
          </Col>
          <Col md={6} style={{ paddingTop: 50 }}>
          <CollapsiblePanel title="Trade all fo Standing Cat" collapse={collapse}>
                <span>{text4}</span>
            </CollapsiblePanel>
          </Col>
          </Row>
        </div>
    );
}

const rootElement = document.getElementById("root");
ReactDOM.render(<App />, rootElement);

function Home4() {
  return (
    <Container fluid className="home-buy-section" id="about">
      <Container>
        <Row>
          {/* <Col md={4} style={{ paddingTop: 50 }}>
            <img
              src={catBull}
              alt="home pic"
              className="img-fluid"
              style={{ maxHeight: "450px" }}
            />
          </Col> */}
          <center>
          <Col md={12}> 
            <h1 className="main-name" style ={{ paddingTop: 25, fontSize: 50, color: '#000000' }}>
                How to Buy
            </h1>
          </Col>
          </center>
          {/* <Col md={4} style={{ paddingTop: 50 }}>
            {/* <img
              src={cat1}
              alt="home pic"
              className="img-fluid"
              style={{ maxHeight: "85px" }}
            /> */}
          {/* </Col> */}
          <h1 className="heading-name" style ={{ paddingTop: 50 }}>
                Lmao the cat is standing lmfao look at the cat that's standing it's funny cuz cats can't stand
              </h1>
              <App />
          {/* <Col md={8} className="home-about-description">
            <h1 style={{ fontSize: "2.6em" }}>
              About <span className="main-name"> Standing Cat </span> 
            </h1>
            <p className="home-about-body">
              Quick BS description of meme coin. Talk about how no tax, no presale, and how this coin will be bullish
            </p>
          </Col> */}
        </Row>
        <Row>
          <Col>
          </Col>
        </Row>
      </Container>
    </Container>
  );
}
export default Home4;
